INSERT INTO `nama_beasiswa` (`id`, `nama_beasiswa`, `singkatan`, `keterangan`, `profil`, `kontak`) VALUES
(1,	'Badan Amil Zakat Nasional',	'Baznas',	'Beasiswa baznas',	'Badan Amil Zakat Nasional (BAZNAS) merupakan badan resmi dan satu-satunya yang dibentuk oleh pemerintah berdasarkan Keputusan Presiden RI No. 8 Tahun 2001 yang memiliki tugas dan fungsi menghimpun dan menyalurkan zakat, infaq, dan sedekah (ZIS) pada tingkat nasional. Lahirnya Undang-Undang Nomor 23 Tahun 2011 tentang Pengelolaan Zakat semakin mengukuhkan peran BAZNAS sebagai lembaga yang berwenang melakukan pengelolaan zakat secara nasional. Dalam UU tersebut, BAZNAS dinyatakan sebagai lembaga pemerintah nonstruktural yang bersifat mandiri dan bertanggung jawab kepada Presiden melalui Menteri Agama.  Dengan demikian, BAZNAS bersama Pemerintah bertanggung jawab untuk mengawal pengelolaan zakat yang berasaskan: syariat Islam, amanah, kemanfaatan, keadilan, kepastian hukum, terintegrasi dan akuntabilitas.',	''),
(8,	'Kartu Jakarta Mahasiswa Unggul',	'KJMU',	'Besaran KJMU<br>\n\na. Bantuan Biaya Peningkatan Mutu Pendidikan diberikan dalam bentuk biaya penyelenggaraan pendidikan dan/atau biaya pendukung personal yaitu sebesar Rp 1.500.000 per bulan.<br>\nb. Biaya penyelenggaraan pendidikan dikelola oleh PTN dan Penyaluran biaya penyelenggaraan pendidikan ke rekening PTN melalui pendebetan dari rekening mahasiswa berdasarkan Surat Kuasa Pendebetan Biaya Penyelenggaraan Pendidikan.',	'Tentang KJMU\r\nKartu Jakarta Mahasiswa Unggul (KJMU) adalah program pemberian bantuan Biaya Peningkatan Mutu Pendidikan bagi calon/mahasiswa PTN/PTS dari keluarga tidak mampu secara ekonomi dan memiliki potensi akademik yang baik untuk meningkatkan akses dan kesempatan belajar di PTN/PTS dengan dibiayai penuh dari dana APBD Provinsi DKI Jakarta.',	''),
(11,	'Van Deventer-Maas Indonesia',	'VDMI',	'Menyalurkan bantuan terutama dalam bentuk beasiswa dan beberapa pelatihan dan proyek sebagai pembekalan dalam meningkatkan kemampuan atau pengembangan potensi diri. Salah satu kegiatan yang menjadi andalan utama adalah Pengembangan Kemampuan Diri Pribadi',	'The Van Deventer-Maas Indonesia was established in September 17, 2018 . The foundation founded by Prof. Irfan Dwidya Prijambada, M.Eng., Ph.D. and Dr. Ing. Ir. Ilya Fadjar Maharika, MA., IAI.  The Foundation donated by Van Deventer-Maas Stichting Netherland as a non profit social organization especially support Indonesian students in Indonesia, as it\'s mission To build young talented Indonesian people to be Mandiri  Van Deventer Maas Stichting is governed by the Boards to ensure the good management of the foundation asset to support the program and the strategic plan of Yayasan Van Deventer-Maas Indonesia and to manage the niche of fund.',	''),
(14,	'Badan Urusan Logistik',	'bulog',	'Beasiswa yang diberikan oleh Badan Urusan Logistik kepada mahasiswa Universitas Negeri Padang',	'Perusahaan Umum Badan Urusan Logistik atau disingkat Perum Bulog adalah sebuah lembaga pangan di Indonesia yang mengurusi tata niaga beras.',	''),
(17,	'Beasiswa Cendekia Baznas',	'BCB',	'Beasiswa Cendekia BAZNAS adalah bantuan pendidikan serta pembinaan pengembangan diri bagi mahasiswa S-1 on-going di 101* kampus mitra Beasiswa BAZNAS.',	'Lembaga Beasiswa BAZNAS adalah program\r\nkhusus Divisi Pendistribusian dan Pendayagunaan\r\nBAZNAS yang memiliki tugas menyediakan dana\r\npendidikan demi terjaminnya keberlangsungan\r\nprogram pendidikan bagi golongan kurang\r\nmampu/miskin sebagai pertanggungjawaban\r\nantar generasi dan menyiapkan generasi penerus\r\nbangsa yang memiliki kedalaman ilmu\r\npengetahuan dan keluhuran akhlak.',	''),
(19,	'Pelindo',	'Pelindo',	'Beasiswa Pelindo',	'Beasiswa Pelindo',	''),
(20,	'Bank Indonesia',	'BI',	'Beasiswa Bank Indonesia adalah salah satu jalur yang bisa ditempuh calon mahasiswa untuk mendapatkan kuliah gratis',	'Beasiswa Bank Indonesia adalah salah satu jalur yang bisa ditempuh calon mahasiswa untuk mendapatkan kuliah gratis',	''),
(21,	'Testing Server',	'Testing',	'Testing server',	'Testing server',	''),
(22,	'Beasiswa Lebong',	'Lebong',	'Beasiswa dari kabupaten lebong',	'Kabupaten Lebong adalah salah satu kabupaten di Provinsi Bengkulu, Indonesia, yang beribu kota di Tubei. Kabupaten ini merupakan kabupaten pemekaran dari kabupaten Rejang Lebong, dengan dasar hukum UU No. 39 Tahun 2003',	''),
(23,	'ADik Difabel',	'Difabel',	'Beasiswa untuk Afirmasi Pendidikan Tinggi yang berstatus difabel',	'Beasiswa untuk Afirmasi Pendidikan Tinggi yang berstatus difabel',	''),
(24,	'Beasiswa Dana Hibah PT Rajawali',	'Rajawali',	'Beasiswa Dana Hibah PT Rajawali  untuk Mahasiswa Strata S1 sebesar Rp 2.000.000,0 /tahun',	'Dana Hibah PT Rajawali',	''),
(25,	'Kartu Indonesia Pintar Kuliah',	'KIP Kuliah',	'KIP Kuliah adalah bantuan biaya pendidikan dari pemerintah bagi lulusan SMA/sederajat yang memiliki potensi akademik baik tetapi memiliki keterbatasan ekonomi',	'KIP Kuliah adalah bantuan biaya pendidikan dari pemerintah bagi lulusan SMA/sederajat yang memiliki potensi akademik baik tetapi memiliki keterbatasan ekonomi',	''),
(26,	'Pancakarsa',	'Pancakarsa',	'Beasiswa Pancakarsa bagi Pemuda Berprestasi',	'Beasiswa Pancakarsa bagi Pemuda Berprestasi',	''),
(27,	'Badan Amil Zakat Nasional (Uji Coba Sistem)',	'Baznas Percobaan Sistem',	'Beasiswa ini untuk ujicoba',	'Beasiswa Ini Untuk Ujicoba',	''),
(28,	'Beasiswa Pendidikan Indonesia (BPI)',	'BPI',	'Beasiswa Pendidikan Indonesia Kementerian Pendidikan,\r\nKebudayaan, Riset, dan Teknologi (BPI Kemendikbudristek)\r\nadalah program beasiswa Pemerintah Indonesia yang bertujuan\r\nuntuk meningkatkan dan membangun sumber daya manusia\r\nIndonesia yang merupakan program kerjasama antara\r\nKemendikbudristek dengan Lembaga Pengelola Dana Pendidikan\r\n(LPDP) Kementerian Keuangan.\r\n',	'BPI Kemendikbudristek terdiri dari program beasiswa bergelar (degree) dan non-gelar (non-degree). Semua\r\njenis program beasiswa bergelar S1, S2, dan S3 untuk perguruan tinggi dalam dan luar negeri dilaksanakan\r\noleh Pusat Layanan Pembiayaan Pendidikan (Puslapdik) Kemendikbudristek.',	'');
